module.exports.getSynhash = function()
{
    return jqSHA1;
};

module.exports.isComponentSupported = function(sPath)
{

    // all lowercase!
    var supportedComponents = ['jquery', 'jquery-mobile', 'jquery-ui', 'jquery-ui-autocomplete', 'jquery-ui-tooltip', 'jquery-ui-dialog', 'yui', 'angularjs', 'jplayer', 'tinymce'];

    sPath = sPath.toLowerCase();


    if(!sPath.startsWith('\\'))
        sPath = '\\' + sPath;
    if(!sPath.endsWith('\\'))
        sPath = sPath + '\\';

    for (let supCom of supportedComponents)
    {
        if(sPath.includes('\\' + supCom + '\\'))
        {
            return true;
        }
    }

    return false;
}

function remcom(s, com)
{
    var maxLoops = 100;
    while(s.includes(com) && maxLoops > 0)
    {
        maxLoops--;
        var comStart = s.indexOf(com);
        var comEnd = s.indexOf('\n', comStart+2);
        if(comEnd === -1)
        {
            comEnd = s.indexOf('\'', comStart+2);
            if(comEnd === -1)
            {
                comEnd = s.indexOf('"', comStart+2);
                if(comEnd === -1)
                {
                    comEnd = comStart + com.length;
                }
            }
        }


        s = s.substr(0, comStart) + s.substr(comEnd);
        //console.log('xxxxxx: ' + s);
    }

    return s;
}

module.exports.synHashPrep = function(s)
{


    var resWords = [
        'this',
        'self',
        ' in ',
        ' of ',
        'if{',
        'if {',
        'else ',
        'else{',
        'var ',
        'true',
        'false',
        'void',
        'typeof',
        'null'

        ];

    // remove multi-line comments

    //var s = 'some /* comment */ code';
    //var s = 'some /* comment */ */ code';
    //var s = 'some */ /* comment */ code';
    //var s = 'some */ */ /* comment */ code';
    //var s = 'some /* comment /* */ code';
    //var s = 'some /* comment */ /* code';
    //var s = 'some /*/* comment */*/  code';
    //var s = 'some /**/ code';
    //var s = 'some /*/ code';
    var maxLoops = 100;
    while(s.includes('/*') && maxLoops > 0)
    {
        maxLoops--;

        var comStart = s.indexOf('/*');
        var comEnd = s.indexOf('*/');
        if(comEnd === (comStart+1))
        {
            comEnd = s.indexOf('*/', comStart+2);
        }
        if(comEnd === -1)
        {
            comEnd = s.length;
            comEnd = comStart+2;
        }
        else if(comEnd < comStart)
        {
            s = s.replace('*/', '');
            continue;
        }

        s = s.substr(0, comStart) + s.substr(comEnd+2);
        //console.log('now: ' + s);
    }
    s = s.replace(/(?:\*\/)/g, '');

    // remove single-line comments

    //var s = `//line1
    //line 2 //comment`;

    s = remcom(s, ' //');
    s = remcom(s, '\t//');
    s = remcom(s, '\n//');
    s = remcom(s, ';//');



    // preserve reserved words
    for(let i=0; i<resWords.length; i++)
    {
        s = s.replace(new RegExp(resWords[i], 'gm'), '!'.repeat(i+1));
    }

    // remove whitespace and everything else except certain characters

    //s = s.replace(/[a-zA-Z0-9.,\-\s\/\*]/gm, '');
    //s = s.replace(/[^\|\{\}\[\]\;\'\"\<\>\&\(\)\_\=\+\`\!\.\,\-\$]/gm, '');
    s = s.replace(/[^\|\{\}\[\]\;\'\"\<\>\&\(\)\_\=\+\`\!\.\,\-\$]/gm, '');  //g



    return s;
}
